const App = () => {
  return (
    <>
      <div>
        <img src={Biman} alt="Biman" />
        <h2>Biman Bangladesh Airlines</h2>
        <p>BG 178 | W & BG 671 | E</p>
        <p>5H 35 MIN</p>
        <Line />
        <p>2 STOPS</p>
      </div>

      <div>
        <Dac />
      </div>

      <div>
        <PlaneButton />
      </div>
      <div>
        <JFK />
      </div>
    </>
  );
};

export default App;
